    return (
    <Layout>
        <Header>
            <Row gutter={16} >
                <Col span={8}   >
                    <Input type="text" placeholder={'please enter step value'} ></Input>
                </Col>
                <Col span={2}   >
                    <Button >Add Counter</Button>
                </Col>
            </Row>
        </Header>
        <Content>
            <Row gutter={16}>

                <Counter/>

            </Row>
        </Content>
    </Layout>
    )
}
